using System;

public static class Snippet
{
	public static System.String GetClrVersion()
	{
		return Environment.Version.ToString();		
	}
}

using System;
using System.Windows.Forms;

using Microsoft.Win32;

public static class Snippet
{
	public static System.Double func(System.String Version, ref System.String InstallPath)
	{
		int release = GetVersionFromRegistry(Version, ref InstallPath);
		return release;
	}

	private static int GetVersionFromRegistry(System.String Version, ref System.String InstallPath) 
	{
		int release = 0;
		string subkey = @"SOFTWARE\Microsoft\NET Framework Setup\NDP\" + Version.Trim() + @"\Full\";
   		using (RegistryKey ndpKey = RegistryKey.OpenBaseKey(RegistryHive.LocalMachine, RegistryView.Registry32).OpenSubKey(subkey)) {
   			if (ndpKey != null && ndpKey.GetValue("Release") != null) {
   				release = (int) ndpKey.GetValue("Release");
				InstallPath = ndpKey.GetValue("InstallPath").ToString();
   			}
   		}

		return release;
	}
}
